import React from 'react';

const GrievanceItem = ({ grievance }) => {
  return (
    <div>
      <h3>{grievance.type}</h3>
      <p>{grievance.description}</p>
      <p>Status: {grievance.status}</p>
    </div>
  );
};

export default GrievanceItem;
